import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="logo">
        <a href="/main">Lost & Found</a>
      </div>
      <div className="links">
        <a href="/main">Home</a>
        <a href="#about-us">About Us</a>
        <a href="#contact-us">Contact Us</a>
        <a href="#profile">Profile</a>
        <a href="/" onClick={() => localStorage.removeItem('isAuthenticated')}>Sign Out</a>
      </div>
    </div>
  );
};
const navbarStyle = {
   // position: 'fixed',
    top: 100,
    left: 0,
    width: '100%',
    zIndex: 1000,
    backgroundColor: '#333',
    color: '#fff',
    padding: '10px 20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    boxShadow: '0 2px 5px rgba(0, 0, 0, 0.2)',
  };

  const linkStyle = {
    color: '#fff',
    textDecoration: 'none',
    margin: '0 15px',
    fontSize: '16px',
    transition: 'color 0.3s ease',
  };

  const linkHoverStyle = {
    color: '#ff9800',
  };

export default Navbar;
